import React, { Component } from 'react';

import Table from './components/Table/Table';

class App extends Component {
   render() {
      return (
         <div>
            <h1 id='title'>React Dynamic Table</h1>
            <table id='items'>
               <tbody>
                  <tr>{this.renderTableHeader()}</tr>
                  {this.renderTableData()}
               </tbody>
            </table>
         </div>
      )
   }

}

export default App;
